# Chulpan, Tolbazinsky Selsoviet, Aurgazinsky District, Republic of Bashkortostan

}}
Chulpan (; , Sulpan) is a rural locality (a village) in Tolbazinsky Selsoviet, Aurgazinsky District, Bashkortostan, Russia. The population was 64 as of 2010.
Geography
It is located 8&nbsp;km from Tolbazy.
